import React from 'react';
import CustomRouter from './components/CustomRouter';
import HomePage from './pages/HomePage';
import ContactPage from './pages/ContactPage';
import SolutionsPage from './pages/SolutionsPage';

const App = () => {
  return (
    <div className="App">
      <CustomRouter  />
      <HomePage />
      <ContactPage />
      <SolutionsPage />

    </div>
  );
}

export default App;
